import sys

def main():
    line = sys.stdin.readline().rstrip('\r\n')
    a, b = map(int, line.split())

    for i in range(1, 100):
        if int(i * 1.08) == a and int(i * 1.1) == b:
            print(i)
            sys.exit()
    print(-1)

